State files an Amended Criminal Complaint charging 1, ct. Child Neglect; 1 ct. Possess Drug Paraphernalia; and 1 ct. Contribute to Delinquency of Child, contrary to Section 948.40(2) of the Wisconsin Statutes.  
Count 3 - Contribute to Delinquency of Child - No contest plea.   Convicted.   State moves to dismiss and read in count 1, child neglect and count 2, possess drug paraphernalia of the amended complaint.   Motion granted.   
Sentence is withheld.   Defendant is placed on probation to DOC for twelve (12) months.   Conditions of probation are:
1) AODA assessment and follow through counseling; 
2) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
3) Submit to random urine screens and pay for same;
4) Maintain full-tme employment/schooling combination;
5) Comply with Human Services;
6) Pay costs of action; 
7) Pay supervision fees in an amount to be determined by DOC;
8) Thirty (30) days jail, imposed and stayed, to be imposed upon the agent's discretion.   
Plea Questionnaire/Waiver of Rights. 
Notice of Right to Seek Postconviction Relief.   
Minutes.
